import logo from '..reportWebVitals';
import '..index'; 


function ReactHome() {


  return (
        <div className="App">
          <header className="App-header">
              <img src={logo} className="App-logo" alt="logo" />
              <p>
                Edit <code>src/App.js</code> and save to reload.
              </p>
              <a
                className="App-link"
                href="https://reactjs.org"
                target="_blank"
                rel="noopener noreferrer"
              >
                Learn React and CSS 
              </a>
            </header>
          </div>
  );
}

export default App;
